import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Cashier from './page/Cashier'; // Ganti dengan path yang sesuai
import Sidebar from './page/Sidebar'; // Pastikan path sidebar benar

const App = () => {
  const username = "KasirUser"; // Ganti sesuai dengan username yang sesuai
  const role = "kasir"; // Ganti sesuai dengan role yang sesuai

  return (
    <Router>
      <div className="flex">
        <Sidebar username={username} role={role} /> {/* Menyertakan Sidebar */}
        <div className="flex-1 p-5">
          <Routes>
            <Route path="/cashier" element={<Cashier />} />
            {/* Tambahkan route lain di sini */}
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
